import React from "react";
import './FaceRecognition.css'

const FaceRecognition = ({ imageUrl, boundingBoxes }) => {

    console.log("BB", boundingBoxes);

    return (
        <div className="relative flex justify-center">
            <div className = "absolute ma3 mw6">
               <img className='' alt='' src='https://previews.123rf.com/images/racorn/racorn1509/racorn150900131/45069171-close-up-group-of-five-cheerful-young-professional-people-inside-the-office-smiling-at-the-camera.jpg' />
               {
                boundingBoxes.map(boxDimensions => {
                    const boxData = {
                        top: `${boxDimensions.top_row*100}%`,
                        right: `${(1-boxDimensions.right_col)*100}%`,
                        bottom: `${(1-boxDimensions.bottom_row)*100}%`,
                        left: `${boxDimensions.left_col*100}%`
                    };
                    const drawBox = {
                        inset: `${boxData.top} ${boxData.right} ${boxData.bottom} ${boxData.left}`
                    };
                    return <div className="box" style={drawBox}></div>
                })
               }
            </div>
        </div>
    );
}

export default FaceRecognition;

